/**
 * 2531. Make Number of Distinct Characters Equal
 *
 * @param {string} word1
 * @param {string} word2
 * @return {boolean}
 */
var isItPossible = function (word1, word2) {
    let freqWord1 = new Map();
    let freqWord2 = new Map();

    for (let c of word1) {
        freqWord1.set(c, -~freqWord1.get(c));
    }
    for (let c of word2) {
        freqWord2.set(c, -~freqWord2.get(c));
    }
    //Невозможно подобрать баланс, если различных букв больше 1
    if (Math.abs(freqWord1.size - freqWord2.size) > 2) {
        return false;
    }

    const sizeWord1 = freqWord1.size;
    const sizeWord2 = freqWord2.size;
    let delSize1, delSize2;
    let curSize1, curSize2;
    for (let c of freqWord1.keys()) {
        for (let b of freqWord2.keys()) {
            delSize1 = freqWord1.get(c) > 1 ? 0 : 1;
            curSize1 = sizeWord1 - delSize1;
            curSize1 += freqWord1.has(b) ? 0 : 1;
            curSize1 += b === c && freqWord1.has(b) && delSize1 === 1 ? 1 : 0;

            delSize2 = freqWord2.get(b) > 1 ? 0 : 1;
            curSize2 = sizeWord2 - delSize2;
            curSize2 += freqWord2.has(c) ? 0 : 1;
            curSize2 += b === c && freqWord2.has(c) && delSize2 === 1 ? 1 : 0;

            if (curSize1 === curSize2) {
                return true;
            }
        }
    }
    return false;
};

console.log(isItPossible("ac", "b"));
console.log(isItPossible("aa", "ab"));
console.log(isItPossible("aa", "bb"));
console.log(isItPossible("abcc", "aab"));
console.log(isItPossible("wilfuzpxqserkdcvbgajtyhon", "rlmyvwvucqxsjodbelmgjkabnxegihuwats"));
console.log(
    isItPossible(
        "",
        ""
    )
);
